import React, {Component} from "react";
import "./About.css";
import prof from "./assets/prof.png"

class About extends Component{
	render() {
		return (
			<div className = "welcome_text">
				<div className = "about">
					<h1 className = "h1"> Hey there! I'm <name className = "name"> Elton</name>. </h1>
					<p className = "bio"> Right now I'm a junior studying computer science at UC Irvine. I love art and music and will always appreciate a good puzzle. Whenever I’m not busy working on schoolwork or personal projects, I like to play the piano or just doodle away mindlessly. As a computer science major and an avid drawing enthusiast, I stand on the intersection of where coding and art meet, and seek to combine these two opposite ends of the spectrum. Feel free to look at what I’ve done!</p>
				</div>
				<img className = "profile_pic"
				 src = {prof}
				/>
			</div>

		);
	}
}

export default About;
